// Paint Utils V1.0

(function(Scratch) {
  'use strict';
    /**
    * @param {number} x
    * @returns {string}
     */
    function formatNumber(x) {
        if (x >= 1e6) {
            return x.toExponential(4)
        } else {
            x = Math.floor(x * 1000) / 1000
            return x.toFixed(Math.min(1, (String(x).split('.')[1] || '').length))
        }
    }

    function span(text) {
        let el = document.createElement('span')
        el.innerHTML = text
        el.style.display = 'hidden'
        el.style.whiteSpace = 'nowrap'
        el.style.width = '100%'
        el.style.textAlign = 'center'
        return el
    }

    class ColourType {
        customId = "paintUtilsColour"

        constructor(h = 0, s = 0, v = 0) {
            this.setHue(h)
            this.setSaturation(s)
            this.setValue(v)
        }

        h = 0
        setHue(x) {
            this.h = (x % 360)
            if (this.h < 0) {
                this.h = 360 + this.h
            }
        }

        s = 0
        setSaturation(x) {
            this.s = Math.max(0, Math.min(x, 1))
        }

        v = 0
        setValue(x) {
            this.v = Math.max(0, Math.min(x, 1))
        }

        static toColor(x) {
        if (x instanceof ColourType) return x
        if (Number(x) == x) return ColorType.fromDecimal(x)
        if (typeof x == 'string') return ColorType.fromHex(x)
        return new ColourType()
    }

    static fromHex(x) {
        if (x.startsWith("#")) x = x.substring(1)
        try {
            if (x.length === 6 || x.length === 7) {
                return ColourType.fromDecimal(Number(`0x${x.slice(0, 6)}`))
            } else if (x.length === 3 || x.length === 4) {
                return ColourType.fromDecimal(Number(`0x${x.slice(0, 3).split("").map(v => v + v).join("")}`))
            }
        } catch {}
        return new ColourType()
    }

    static fromRGB(r, g, b) {
        r = Math.max(0, Math.min(r / 255, 1))
        g = Math.max(0, Math.min(g / 255, 1))
        b = Math.max(0, Math.min(b / 255, 1))

        let v = Math.max(r, g, b), c = v - Math.min(r, g, b)
        let h = c && ((v == r) ? (g - b) / c : ((v == g) ? 2 + (b - r) / c : 4 + (r - g) / c))
        return new ColourType(60 * (h < 0 ? h + 6 : h), v && c / v, v)
    }

    static fromDecimal(d) {
        const r = (d >> 16) & 0xFF
        const g = (d >> 8) & 0xFF
        const b = d & 0xFF
        return this.fromRGB(r, g, b)
    }

    jwArrayHandler() {
        let colour = document.createElement('div')
        colour.style.width = "16px"
        colour.style.height = "16px"
        colour.style.border = "1px solid black"
        colour.style.borderRadius = "4px"
        colour.style.boxSizing = "border-box"
        colour.style.backgroundColor = `#${this.toHex()}`
        colour.style.display = "inline-block"
        colour.style.verticalAlign = "text-bottom"

        return colour.outerHTML
    }

    toString() {
        return String(this.toDecimal())
    }
    toMonitorContent = () => span(this.toString())

    toReporterContent() {
        let root = document.createElement('div')
        root.style.display = 'flex'
        root.style.width = "200px"
        root.style.overflow = "hidden"
        let details = document.createElement('div')
        details.style.display = 'flex'
        details.style.flexDirection = 'column'
        details.style.justifyContent = 'center'
        details.style.width = "100px"
        details.appendChild(span(`<b>H:</b> ${formatNumber(Math.round(this.h))}`))
        details.appendChild(span(`<b>S:</b> ${formatNumber(this.s * 100)}%`))
        details.appendChild(span(`<b>V:</b> ${formatNumber(this.v * 100)}%`))
        root.appendChild(details)
        let colour = document.createElement('div')
        colour.style.width = "84px"
        colour.style.height = "84px"
        colour.style.margin = "8px"
        colour.style.border = "2px solid black"
        colour.style.borderRadius = "8px"
        colour.style.boxSizing = "border-box"
        colour.style.backgroundColor = `#${this.toHex()}`
        root.appendChild(colour)
        return root
    }

    toRGB() {
        let f = (n, k = (n + this.h / 60) % 6) => this.v - this.v * this.s * Math.max(Math.min(k, 4 - k, 1), 0)
        return [Math.round(f(5) * 255), Math.round(f(3) * 255), Math.round(f(1) * 255)]
    }

    toDecimal() {
        let [r, g, b] = this.toRGB()
        return r * 0x10000 + g * 0x100 + b * 0x1
    }

    toHex() {
        return this.toDecimal().toString(16).padStart(6, "0")
    }
  }

    class Colour {
        constructor(name, hex) {
            this.Name = name
            this.Colour = ColourType.fromHex(hex)
        }
    }

    class ColourRecipe {
        constructor(reqColour1, reqColour2, rtnColour) {
            if (reqColour1 instanceof Colour && reqColour2 instanceof Colour && rtnColour instanceof Colour) {
                this.Colour1 = reqColour1
                this.Colour2 = reqColour2
                this.ReturnColour = rtnColour
            }
        }

        attemptToMix(colour1, colour2) {
            if (colour1 instanceof Colour && colour2 instanceof Colour) {
                if ((this.Colour1.Name === colour1.Name || this.Colour1.Name === colour2.Name) && (this.Colour2.Name === colour2.Name || this.Colour2.Name === colour1.Name)) {
                    return this.ReturnColour
                } else {
                    return null
                }
            } else {
                return null
            }
        }
    }

    class ColourMixer {
        constructor() {
            this.colours = new Map()

            this.colours.set("red", new Colour("red", "#FE2712"))
            this.colours.set("vermillion", new Colour("vermillion", "#FD5308"))
            this.colours.set("orange", new Colour("orange", "#FB9902"))
            this.colours.set("amber", new Colour("amber", "#FABC02"))
            this.colours.set("yellow", new Colour("yellow", "#FEFE33"))
            this.colours.set("chartreuse", new Colour("chartreuse", "#D0EA2B"))
            this.colours.set("green", new Colour("green", "#66B032"))
            this.colours.set("teal", new Colour("teal", "#0392CE"))
            this.colours.set("blue", new Colour("blue", "#0247FE"))
            this.colours.set("violet", new Colour("violet", "#3D01A4"))
            this.colours.set("purple", new Colour("purple", "#8601AF"))
            this.colours.set("magenta", new Colour("magenta", "#A7194B"))

            this.colourRecipes = new Map()

            this.colourRecipes.set("orangeRecipe", new ColourRecipe(this.colours.get("red"), this.colours.get("yellow"), this.colours.get("orange")))
            this.colourRecipes.set("greenRecipe", new ColourRecipe(this.colours.get("yellow"), this.colours.get("blue"), this.colours.get("green")))
            this.colourRecipes.set("purpleRecipe", new ColourRecipe(this.colours.get("blue"), this.colours.get("red"), this.colours.get("purple")))

            this.colourRecipes.set("vermillionRecipe", new ColourRecipe(this.colours.get("red"), this.colours.get("orange"), this.colours.get("vermillion")))
            this.colourRecipes.set("amberRecipe", new ColourRecipe(this.colours.get("orange"), this.colours.get("yellow"), this.colours.get("amber")))
            this.colourRecipes.set("chartreuseRecipe", new ColourRecipe(this.colours.get("yellow"), this.colours.get("green"), this.colours.get("chartreuse")))
            this.colourRecipes.set("tealRecipe", new ColourRecipe(this.colours.get("green"), this.colours.get("blue"), this.colours.get("teal")))
            this.colourRecipes.set("violetRecipe", new ColourRecipe(this.colours.get("blue"), this.colours.get("purple"), this.colours.get("violet")))
            this.colourRecipes.set("magentaRecipe", new ColourRecipe(this.colours.get("purple"), this.colours.get("red"), this.colours.get("magenta")))
        }

        mix(colour1, colour2) {
            let toReturn = null

            for (let value of this.colourRecipes.values()) {
                if (value instanceof ColourRecipe) {
                    toReturn = value.attemptToMix(colour1, colour2)

                    if (toReturn === null) {
                        continue
                    } else {
                        break
                    }
                } else {
                    continue
                }
            }

            if (toReturn === null) {
                throw new Error("Invalid colour mixing recipe.")
            }

            return toReturn
        }
    }

    const colourMixer = new ColourMixer()
    const paintUtilsIcon = "data:image/png;base64,"

    class Extension {
        constructor() {
            vm.runtime.registerSerializer(
                "paintUtilsColour",
                v => [v.h, v.s, v.v],
                v => new Color.Type(...v)
            );
        }

        getInfo() {
            return {
                id: "fruitsPaintUtils",
                name: "Paint Utils",
                menuIconURI: paintUtilsIcon,
                blockIconURI: paintUtilsIcon,
                docsURI: "https://extensions.penguinmod.com/docs/PaintUtils",
                color1: "#d1d1d1",
                color2: "#999999",
                color3: "#999999",
                blocks: [
                {
                    opcode: 'mixColours',
                    text: "mix colours [COLOUR_NAME1] and [COLOUR_NAME2] and return the [MIX_OPTIONS]",
                    blockType: Scratch.BlockType.REPORTER,
                    disableMonitor: true,
                    arguments: {
                        COLOUR_NAME1: {
                            type: Scratch.ArgumentType.STRING,
                            defaultValue: "blue"
                        },

                        COLOUR_NAME2: {
                            type: Scratch.ArgumentType.STRING,
                            defaultValue: "yellow"
                        },

                        MIX_OPTIONS: {
                            type: Scratch.ArgumentType.STRING,
                            menu: "MIX_OPTIONS"
                        }
                    }
                },
                {
                    opcode: "getColour",
                    text: "get colour from colour name [COLOUR_NAME]",
                    blockType: Scratch.BlockType.REPORTER,
                    disableMonitor: true,
                    arguments: {
                        COLOUR_NAME: {
                            type: Scratch.ArgumentType.STRING,
                            defaultValue: "green"
                        },
                    }
                }
            ],

            menus: {
                MIX_OPTIONS: {
                    acceptReporters: false,
                    items: [
                        {text: "colour name", value: "colourName"},
                        {text: "colour", value: "colour"}
                    ]
                }
            }
        };
    }
    

    mixColours(args) {
        const colourName1 = Scratch.Cast.toString(args.COLOUR_NAME1).toLowerCase()
        const colourName2 = Scratch.Cast.toString(args.COLOUR_NAME2).toLowerCase()
        const mix_options = args.MIX_OPTIONS
        
        const colour1 = colourMixer.colours.get(colourName1)
        const colour2 = colourMixer.colours.get(colourName2)

        if ((!colour1 || !colour2) || (!colour1 && !colour2)) {
            throw new Error("Invalid colours found in block.")
        }

        switch (mix_options) {
            case "colourName":
                const colourName = colourMixer.mix(colour1, colour2).Name
                return colourName
            case "colour":
                const colour = colourMixer.mix(colour1, colour2).Colour
                return colour
            default:
                return null
        }
    }

    getColour(args) {
        const colourName = Scratch.Cast.toString(args.COLOUR_NAME).toLowerCase()

        const colourRaw = colourMixer.colours.get(colourName)

        if (!colourRaw) {
            throw new Error("Invalid colour.")
        }

        const colour = colourRaw.Colour
        return colour
    }
  }

  Scratch.extensions.register(new Extension());
})(Scratch);
